class Vector2D:

    def __init__(self, v: List[List[int]]):
        self.data = []
        for l in v:
            self.data.extend(l)
        self.pos = -1

    def next(self) -> int:
        self.pos += 1
        return self.data[self.pos]

    def hasNext(self) -> bool:
        return self.pos < len(self.data) - 1


