class Solution254:

    def getFactors(self, n: int) -> List[List[int]]:
        """GOOD"""
        res = []

        def dfs(num, factors):
            i = 2 if not factors else factors[-1]
            while i <= num // i:
                if num % i == 0:
                    factors.append(i)
                    factors.append(num // i)
                    res.append(list(factors))
                    factors.pop()
                    dfs(num // i, factors)
                    factors.pop()
                i += 1

        dfs(n, [])
        return res


